import React from "react";
import { Container } from "react-bootstrap";

const Map = () => {
    return (
        <div className="map">
            <Container>
                <iframe
                    src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1959.2558075511495!2d106.76519466640835!3d10.848637565370902!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x317527002adbc953%3A0x655feb004c8d22c8!2sShaman%20Tea!5e0!3m2!1sen!2s!4v1718614834632!5m2!1sen!2s"
                    width="100%"
                    height="550"
                    loading="lazy"
                ></iframe>
            </Container>
        </div>
    );
};

export default Map;
